class Solution:
    def longestPalindrome(self, s: str) -> str:
        pString = []
        vals = {}
        if len(s) == 1:
            return s
        
        for i in range(0, len(s)+1):
            for j in range(0, len(s)+1):
                if i == j:
                    if s[i-1:j] != '':
                        self.isPelindrom(s[i-1:j],pString,vals)
                else:
                    if s[i:j] != '':
                        self.isPelindrom(s[i:j],pString,vals)
        
        
        s = vals[str(max(pString))]
        return s


    def isPelindrom(self, string: str,pString,vals):
        orig = string
        n = string[::-1]
        if orig == n:
            pString.append(len(orig))
            vals[str(len(orig))] = orig


sol = Solution()
print(sol.longestPalindrome(""))
print(sol.longestPalindrome(""))